The Third Mainland Bridge is the longest of three bridges connecting Lagos Island to the mainland, the other two being the Eko and Carter bridges. It was the longest bridge in Africa until 1996 when the 6th October Bridgelocated in Cairo was completed. The bridge starts from Oworonshoki which is linked to the Apapa-Oshodi express way and Lagos-Ibadanexpress way, and ends at the Adeniji Adele Interchange on Lagos Island. There is also a link midway through the bridge that leads to the Herbert Macaulay Way, Yaba. The bridge was built by Julius Berger Nigeria PLC and opened by President Ibrahim Babangida in 1990; it measures about 11.8 km in length.

